    [],nt"revision_timestamp": "2016-07-27T23:02:00.530535",nt"name": "bald-eagle-ground-census-chilkat-valley-alaska-11-12-november-1983",nt"isopen":
    false,nt"url": null,nt"notes": "In 1979, the National Audubon Society initiated
    studies of the bald eagles inhabiting the Chilkat River valley. Aerial surveys and
    ground counts of bald eagles were made along the Chilkat and Klehini Rivers as part
    of these studies. Audubon's active involvement in field studies ended after the
    winter of 1982-83, but we deemed it important to continue a lower intensity surveillance
    of the Chilkat bald eagle concentration. We propose to conduct at least 3 aerial
    surveys and 2 ground counts during the concentration period of late October through
    early December. This paper reports the results of our initial ground census conducted
    on 11-12 November 1983.",nt"license_title": "License Not Specified",nt"extras":
